description:
Fairy Tale Newlyweds Jack (Eric Masterson) and Jill (Stormy Daniels) move to the suburbs to escape their hectic city life. Unfortunately for them, their new garden is inhabited by a mischievous fairy (Kaylani Lei) who becomes obsessed with the man of the house, threatening to tear the newlyweds apart. As Jill becomes suspicious that something is going on with the house, she turns to her neighbors to get the scoop on the former tenants. It seems that everyone who lives in the house starts behaving strangely. When Jack finally tells Jill the truth, Jill decides to confront the tiny fairy with hilarious results. Will Jack and Jill's marriage survive? Can they live happily ever after in this Fairy Tale? Find outÃ¢â‚¬Â¦

